css:
.editor-colors {
  background-color: #f7f4ef;
  color: #030f3e;
}
.editor {
  background-color: #f7f4ef;
  color: #030f3e;
}
.editor .wrap-guide {
  background-color: #d0c8be;
}
.editor .indent-guide {
  color: #b2c9e3;
}
.editor .invisible-character {
  color: #b2c9e3;
}
.editor .gutter {
  background-color: #d0c8be;
  color: #140701;
  margin-right: 2.5em;
}
.editor .gutter .line-number.cursor-line {
  background-color: #8e7d67;
  color: #140701;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #140701;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #155275;
}
.editor .selection .region {
  background-color: #ded1bc;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #155275;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #9ca3b0;
}
.entity.name.type {
  color: #dcab1b;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #8ba524;
}
.keyword {
  color: #0aa16c;
}
.keyword.control {
  color: #0aa16c;
}
.keyword.operator {
  color: #04412c;
}
.keyword.other.special-method {
  color: #7080da;
}
.keyword.other.unit {
  color: #8ba524;
}
.storage {
  color: #620a92;
}
.constant {
  color: #d27001;
}
.constant.character.escape {
  color: #0aa16c;
}
.constant.numeric {
  color: #d27001;
}
.constant.other.color {
  color: #0aa16c;
}
.constant.other.symbol {
  color: #8ba524;
}
.variable {
  color: #7080da;
}
.variable.interpolation {
  color: #475cd0;
}
.variable.parameter.function {
  color: #030f3e;
}
.invalid.illegal {
  background-color: #d34545;
  color: #f7f4ef;
}
.string.interpolated {
  background-color: rgba(255, 255, 0, 0.07);
}
.string.quoted {
  background-color: rgba(255, 255, 0, 0.07);
  color: #7080da;
}
.string.regexp {
  color: #0aa16c;
}
.string.regexp .source.ruby.embedded {
  color: #d27001;
}
.string.other.link {
  color: #d34545;
}
.punctuation.definition.comment {
  color: #808999;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #7080da;
}
.punctuation.definition.bold {
  color: bold-color;
  font-style: bold;
}
.punctuation.section.embedded {
  color: #b92c2c;
}
.support.class {
  color: #dcab1b;
}
.support.function {
  color: #030f3e;
}
.support.function.any-method {
  color: #d34545;
}
.entity.name.function {
  color: #d34545;
}
.entity.name.class,
.entity.name.type.class {
  color: #dcab1b;
}
.entity.name.section {
  color: #d34545;
}
.entity.name.tag {
  color: #d34545;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #d27001;
}
.entity.other.attribute-name.id {
  color: #7080da;
}
.meta.class {
  color: ink;
}
.meta.brace {
  color: #d34545;
}
.meta.link {
  color: #d27001;
}
.meta.require {
  color: #7080da;
}
.meta.selector {
  color: #d27001;
}
.meta.separator {
  background-color: #030f3e;
  color: #030f3e;
}
.none {
  color: #030f3e;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
/*---------------------------------------
 below: optional extra stuff for addon packages
-----------------------------------------*/
.highlights .highlight-selected .region {
  border-radius: 4px;
  box-sizing: content-box;
  padding: 0 1px 0 0;
  margin: -1px 0 0 -1px;
  background-color: transparent;
  border-width: 1.5px;
  border-style: dashed;
}
.highlights .bracket-matcher {
  border: 5px solid rgba(241, 190, 247, 0.61);
  position: absolute;
}
.highlights .highlight-selected.light-theme .region {
  border-color: rgba(238, 11, 143, 0.8);
}
.highlights .highlight-selected.light-theme.background .region {
  background-color: rgba(236, 13, 132, 0.35);
}
.markup.changed {
  color: #620a92;
}
.markup.deleted {
  color: #d34545;
}
.markup.italic {
  color: #1371a7;
  font-style: italic;
}
.markup.bold {
  color: #0e5279;
  font-weight: bold;
}
.markup.heading .punctuation.definition.heading {
  color: #7080da;
}
.markup.inserted {
  color: #8ba524;
}
.markup.list {
  color: #e24129;
  font-weight: bold;
}
.markup.quote {
  color: #794b16;
}
.markup.raw.inline {
  color: #8ba524;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #140701;
  position: relative;
  left: 0px;
}
.source.gfm .markup.heading.heading-1 {
  font-size: 145%;
  top: -8px;
}
.source.gfm .markup.heading.heading-2 {
  font-size: 130%;
  top: -6px;
}
.source.gfm .markup.heading.heading-3 {
  font-size: 115%;
  top: -3px;
}
.gfm .markup.underline {
  text-decoration: underline;
}
.gfm .markup.strike {
  text-decoration: line-through;
}
.gfm.quote {
  color: #794b16;
  font-style: italic;
}
.gfm.entity {
  color: #155275;
}
.gfm.username {
  color: #aa5c08;
}
.gfm.mention {
  color: rgba(205, 118, 42, 0.43);
}
.gfm.list {
  color: #e24129;
  font-weight: bold;
}
